import React from 'react';
import './LowerNavbar.css';
import { BrowserRouter, Route, Switch } from "react-router-dom";

export default function LowerNavbar() {
    return (
        <BrowserRouter>
            <div>
                <Menu />
                <Switch>
                    <Route path="/" exact component={Login} />
                    <Route path="/Reg" component={Reg} />
                </Switch>
            </div>
        </BrowserRouter>
    )
}
